import React from "react";
import "./Footer.css";

function Footer (){
    return(
      <div className="container">
          <div className="row">
              <div className="footer-text">
                  <h6>CryptoShinobi Limited &copy;</h6>
              </div>
              <div className="footer-icons">
                  <img src="./Icons/facebook.png" alt="facebook" />
              </div>
          </div>
      </div>
    );
}

export default Footer;
